import sqlite3


def addTableToDatabase(table_name, table):
  conn = sqlite3.connect('databases/raw_articulations.db')

  cursor = conn.cursor()
  query = 'CREATE TABLE IF NOT EXISTS "' + table_name + '" (id TEXT PRIMARY KEY, paths TEXT, notes TEXT)'
  cursor.execute(query)
  query = 'INSERT OR REPLACE INTO "' + table_name + '" (id, paths, notes) VALUES (?, ?, ?)'
  cursor.executemany(query, table)

  conn.commit()

  cursor.close()
  conn.close()


